import SearchingBar from "../Components/SearchingBar";
import React from "react";
import "../index.css";
import { useState } from "react";

import UpcomingMovies from "../Components/UpcomingMovies";

function Home() {
  return (
    <div>
      <div>
        <div id='home-container'>
          <div id='home-name'>
            <h1>Home</h1>
          </div>
        </div>
      </div>
      <div>
        <SearchingBar />
      </div>
      <div>
        <UpcomingMovies />
      </div>
    </div>
  );
}

export default Home;
